import React, { Component } from 'react';
import './App.css';

class App extends Component {

  state = {
    spartans: []
  }

  handleButtonClick() {
    fetch('/spartans')
      .then(res => res.json())
      .then(spartans => this.setState({spartans}));
  }

  render(){
    return (
      <div className="App">

        <div class="initialEntry">
            <h1> UNSC CLASSIFIED INFORMATION</h1>
            <button onClick={this.handleButtonClick} class="button">ENTER</button>
        </div>

        <div class="access">
          <h1>Spartans</h1>
          { this.state.spartans.map(spartans =>
            <li key={spartans._id}>{spartans.name}</li>
          )}
        </div>

      </div>
    );
  }

}

export default App;
